/**
 * @class
 */
export default class SLA {
   /**
    * @constructor
    * @param {*} projectID
    * @param {*} slaTypeID
    * @param {*} SLA
    * @param {*} description
    * @param {*} target
    * @param {*} logic
    */
   constructor(projectID, slaTypeID, SLA, description, target, logic) {
      this.projectID = projectID;
      this.slaTypeID = slaTypeID;
      this.SLA = SLA;
      this.description = description;
      this.target = target;
      this.logic = logic;
   }

   /**
    * @public
    */
   static getSLADTO() {
      return {
         SLA: {
            projectID: this.projectID,
            slaTypeID: this.slaTypeID,
            SLA: this.SLA,
            description: this.description,
            target: this.target,
            logic: this.logic
         }
      };
   }
}
